	scwin.lfn_calSave_onClick = function() {
		except = "calPrem";

	    //   .
	    if (scwin.lfn_ValidationCheck("level3")) {
	        return;
	    }

	    // 
	    if (scwin.lfn_checkMinPremAmt() == false) {
	        return;
	    }
	    if (modifyFlag) {
	        wprom.alert(" .\n  .");
	        return;
	    }
	    var nGrntPrem = wconv.toNumber(Ds_LTIDA00.getCellData(0, "nGrntPrem")); //
	    var nAccuPrem = wconv.toNumber(Ds_LTIDA00.getCellData(0, "nAccuPrem")); //
	    //var nBussPrem = ToNumber(Ds_LTIDA00.GetColumn(0, "nBussPrem"));//
	    var nBussPrem = wconv.toNumber(medt_nBussPrem.getValue()); //
	    var nDcPrem = wconv.toNumber(Ds_LTIDA00.getCellData(0, "nDcPrem")); //
	    var nApplPrem = wconv.toNumber(Ds_LTIDA00.getCellData(0, "nApplPrem")); //
	    var nMinPrem = wconv.toNumber(Ds_LTIDA00.getCellData(0, "nMinPrem")); //
	    var nMaxPrem = wconv.toNumber(Ds_LTIDA00.getCellData(0, "nMaxPrem")); //
	    var nGroupDcrt = wconv.toNumber(Ds_LTIEA10.getCellData(0, "nGroupDcrt")) / 100; //
	    //  /  
	    if (!mfn_IsEmpty(wconv.toString(nBussPrem)) && nBussPrem >= nMinPrem && nBussPrem <= nMaxPrem) {
	    } 
	    else {
	        wprom.alertF(" /   .", {}, medt_nBussPrem);
	        //medt_nBussPrem.focus();
	        return;
	    }	

	    // =  - 
	    nAccuPrem = nBussPrem - nGrntPrem;

	    // =  X .
	    nDcPrem = nBussPrem * nGroupDcrt;

	    // =  - 
	    //nApplPrem = nBussPrem - nDcPrem;
	    //trace("nGrntPrem="+nGrntPrem+"==nDcPrem=="+nDcPrem+"==nApplPrem=="+nApplPrem);
	    Ds_LTIDA00.setCellData(0, "nAccuPrem", wconv.toString(nAccuPrem)); //
	    Ds_LTIDA00.setCellData(0, "nDcPrem", wconv.toString(nDcPrem)); //
	    Ds_LTIDA00.setCellData(0, "nApplPrem", wconv.toString(nApplPrem)); //

	    // 
	    var MethodObj = new callService("com.inswave.longterm.ssr.pln.task.DBB340Task", "updateCalcPrem", "", "");
	    MethodObj.setId("updateCalcPrem");

	    // 
	    MethodObj.addSingleData("LTIDA00", "LTIDA00", Ds_LTIDA00.getID()); // 
